import React, { useEffect } from "react";
const { default: CTable } = require("src/Components/Table/CTable");

const Product = () => {
    const dispatch = useDispatch();
    useEffect(() => {
       dispatch(getPro);
    }, [])
  return (
    <>
      <CTable
        header={[
          "#",
          "Item Name",
          "Item Code",
          "Current Stock",
          "Last Updated",
          "Action",
        ]}
      ></CTable>
    </>
  );
};
export default Product;
